import React from "react";
import { Layout, Menu } from "antd";
import { Link } from "react-router-dom";

const { Header } = Layout;

const AppHeader= () => {
  return (
    <Header style={{ display: "flex", justifyContent: "space-between", alignItems: "center", background: "#fff", padding: "0 20px", boxShadow: "0px 2px 8px rgba(0, 0, 0, 0.1)" }}>
      {/* Logo */}
      <div>
        <Link to="/" style={{ fontSize: "20px", fontWeight: "bold", color: "#000" }}>
          üè¢ Co-Working Space
        </Link>
      </div>

      {/* Navigation Menu */}
      <Menu mode="horizontal" theme="light" selectable={false}>
        <Menu.Item key="home">
          <Link to="/">Home</Link>
        </Menu.Item>
        <Menu.Item key="booking">
          <Link to="/booking">Book a Space</Link>
        </Menu.Item>
      </Menu>
    </Header>
  );
};

export default AppHeader;
